import React, { Component } from 'react';
import { BECIEstimated, BECIMinimum } from './data/BECI';
import LineChart from './LineChart';
import * as _ from 'lodash';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selected: 4,
      estimatedData: _.cloneDeep(BECIEstimated),
      minimumData: _.cloneDeep(BECIMinimum),
      title: 'Bitcoin Energy Consumption Index'
    };
  }
  render() {
    let content;
    content = <LineChart estimatedData={this.state.estimatedData} minimumData={this.state.minimumData} title={this.state.title} />;

    return (
      <div className="App">
        <div className="App-header">
          <h2>Cryptocurrency Energy Consumption Visualization</h2>
        </div>
        <div className="container">
          {content}
        </div>
      </div>
    );
  }
}

export default App;
